import React from "react";
import Text from "../components/text";
import Container from "../components/container";

const Index = () => (
  <Container>
    <Text>안녕, Next.js</Text>
    <style jsx global>
      {`
      body{
        disply:none;
      }
      `}
    </style>
  </Container>
);

export default Index;
